            pt: "</br>Estamos entusiasmados em anunciar a mais recente atualiza\u00e7\u00e3o do WhatsUp+, trazendo uma integra\u00e7\u00e3o direta com o poderoso ChatGPT. Agora voc\u00ea pode enviar mensagens para o ChatGPT diretamente na sua conversa do WhatsApp e receber respostas imediatas, seja em texto ou em \u00e1udio. A experi\u00eancia de comunica\u00e7\u00e3o nunca foi t\u00e3o fluida e intuitiva!\n\n            </br></br>Com o ChatGPT conectado ao seu WhatsApp, as possibilidades s\u00e3o infinitas. Voc\u00ea pode fazer perguntas, buscar informa\u00e7\u00f5es, obter sugest\u00f5es e at\u00e9 mesmo bater um papo casual com essa intelig\u00eancia artificial avan\u00e7ada. Basta digitar /texto para receber respostas em formato de texto ou /audio para receber respostas em \u00e1udio.\n\n            </br></br>Experimente o novo recurso de Conex\u00e3o com o ChatGPT no WhatsUp+ agora clicando no bot\u00e3o abaixo e aproveite todas as possibilidades e benef\u00edcios! Estamos ansiosos para ajud\u00e1-lo em suas conversas e tornar sua experi\u00eancia no WhatsApp ainda mais incr\u00edvel!",
